textOriginal:
Comentando aqui o programa do dia 26/10. Admiro o Márcio Gomes e demais por manter a classe em ter um colega tão claramente parcial como esse Fernão. Antes da palavra ser passada a ele, eu já sei oq ele vai fazer: Primeiro, ignorar os fatos,;
Segundo, desqualificar as provas;
E no fim, expôr a sua teoria da conspiração.
